import { Typography } from '@material-ui/core'
import React from 'react'



function UnitsDashBoard(props) {
    return (
        <div>
            <Typography className="title">
                {props.title}
            </Typography>
            <Typography className="grade">
                {props.grade}
            </Typography>
        </div>
    )
}

export default UnitsDashBoard
